                <li>
                    {/* <a class="list-group-item" href="./home-message.html">Message</a> */}
                    <MyNavLink to="">Message</MyNavLink>
                </li>
                </ul>
                {/* 注册路由 */}
                <News/>
                <Message/>
            
            </div>
          </div>
        )
    }
}
